import React from 'react'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './pages/Home'
import ModeChoice from './pages/ModeChoice'


const App = () => {
  const [question2, setQuestion2] = useState('');

  const handleQuestion2Change = (value) => {
    setQuestion2(value);
  }

  return (
    <BrowserRouter>
      <Routes>
      <Route exact path="/">
          <Home handleQuestion2Change={handleQuestion2Change} />
        </Route>
        <Route path="/modeChoice">
          <ModeChoice question2={question2} />
        </Route>


      </Routes>
    </BrowserRouter>
  )
}

export default App
